import React, { useState } from 'react'
import { v4 } from 'uuid'
import Root from './Root'

const Tree = () => {
  const [nodes, setNodes] = useState([{ id: v4(), name: 'root', children: [] }])

  return (
    <div>
      {nodes.map((node, index) => (
        <Root key={index} />
      ))}
    </div>
  )
}

export default Tree
